				'Need a <b>gluten free, lacto ovo vegetarian, and ketogenic main course</b>? Asparagus and Asiago Frittata could be a tremendous recipe to try. This recipe serves 4 and costs $1.79 per serving. One serving contains <b>254 calories</b>, <b>17g of protein</b>, and <b>19g of fat</b>. A few people made this recipe, and 13 would say it hit the spot. A mixture of salt, ground pepper, butter, and a handful of other ingredients are all it takes to make this recipe so tasty. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. With a spoonacular <b>score of 47%</b>, this dish is solid. Try <a href="https://spoonacular.com/recipes/kale-asiago-frittata-584923">Kale & Asiago Frittata</a>, <a href="https://spoonacular.com/recipes/kale-asiago-skillet-frittata-711751">Kale Asiago Skillet Frittata</a>, and <a href="https://spoonacular.com/recipes/asiago-kohlrabi-noodle-frittata-with-corn-bacon-and-basil-605379">Asiago Kohlrabi Noodle Frittata with Corn, Bacon and Basil</a> for similar recipes.',
