			summary:
				'One serving contains <b>863 calories</b>, <b>12g of protein</b>, and <b>63g of fat</b>. For <b>$2.1 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 111 foodies and cooks. It can be enjoyed any time, but it is especially good for <b>Easter</b>. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. If you have cream cheese, vanillan extract, vegetable oil, and a few other ingredients on hand, you can make it. It is a good option if you\'re following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 64%</b>. This score is pretty good. Try <a href="https://spoonacular.com/recipes/classic-carrot-cake-with-cream-cheese-frosting-61463">Classic Carrot Cake With Cream Cheese Frosting</a>, <a href="https://spoonacular.com/recipes/classic-carrot-cake-with-cream-cheese-frosting-612651">Classic Carrot Cake with Cream Cheese Frosting</a>, and <a href="https://spoonacular.com/recipes/classic-carrot-cake-with-fluffy-cream-cheese-frosting-61433">Classic Carrot Cake with Fluffy Cream Cheese Frosting</a> for similar recipes.',
			cuisines: [],
			dishTypes: ['side dish'],
			diets: ['lacto ovo vegetarian'],
			occasions: ['easter'],
			instructions:
				"<ol><li>Preheat the oven to 325. Butter two 9-inch cake pans; line the bottoms with parchment. Butter the paper and flour the pans.</li><li>For the cake:</li><li>Spread the pecans on a baking sheet and toast for 8 minutes, until fragrant. Cool and finely chop.</li><li>In a bowl, whisk the flour, baking powder, baking soda, cinnamon and salt.</li><li>In a small bowl, whisk the oil, buttermilk and vanilla.</li><li>In a large bowl, using an electric mixer, beat the eggs and sugar at high speed until pale, 5 minutes.</li><li>Beat in the liquid ingredients, then beat in the dry ingredients just until moistened.</li><li>Stir in the carrots and pecans.</li><li>Divide the batter between the pans and bake the cakes for 55 minutes to 1 hour, until springy and golden.</li><li>Let the cakes cool on a rack for 30 minutes, then unmold the cakes and let cool completely.</li><li>For the Frosting:</li><li>In a large bowl, using an electric mixer, beat the butter and cream cheese at high speed until light, about 5 minutes.</li><li>Beat in the vanilla, then the confectioners' sugar; beat at low speed until incorporated. Increase the speed to high and beat until light and fluffy, about 3 minutes.</li><li>Peel off the parchment paper and invert one cake layer onto a plate. Spread with a slightly rounded cup of the frosting. Top with the second cake layer, right side up. Spread the top and sides with the remaining frosting and refrigerate the cake until chilled, about 1 hour.</li></ol>",
