			summary:
				'Vegetarian Christmas wreath might be a good recipe to expand your side dish recipe box. One portion of this dish contains roughly <b>4g of protein</b>, <b>19g of fat</b>, and a total of <b>198 calories</b>. This recipe serves 8 and costs 76 cents per serving. It is a good option if you\'re following a <b>gluten free</b> diet. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. Head to the store and pick up broccoli florets, cream cheese, bell pepper, and a few other things to make it today. 10 people were glad they tried this recipe. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 18%</b>, which is not so excellent. Try <a href="https://spoonacular.com/recipes/christmas-wreath-cookies-404306">Christmas Wreath Cookies</a>, <a href="https://spoonacular.com/recipes/christmas-wreath-bread-367948">Christmas Wreath Bread</a>, and <a href="https://spoonacular.com/recipes/rainbow-christmas-wreath-173390">Rainbow Christmas Wreath</a> for similar recipes.',
