			summary:
				'If you have roughly <b>roughly 45 minutes</b> to spend in the kitchen, Banana Chocolate Chip Cake With Peanut Butter Frosting - gluten free, dairy free, soy free might be an awesome <b>gluten free, dairy free, and fodmap friendly</b> recipe to try. One portion of this dish contains around <b>116g of protein</b>, <b>125g of fat</b>, and a total of <b>6400 calories</b>. This recipe serves 8. For <b>$11.02 per serving</b>, this recipe <b>covers 76%</b> of your daily requirements of vitamins and minerals. It is brought to you by Foodista. If you have you will need: two cake pans, eggs, rice flour, and a few other ingredients on hand, you can make it. 7 people were impressed by this recipe. It works well as a dessert. Overall, this recipe earns a <b>super spoonacular score of 89%</b>. Try <a href="https://spoonacular.com/recipes/healthy-chunky-monkey-cake-aka-peanut-butter-banana-cake-with-chocolate-peanut-butter-frosting-sugar-free-high-protein-gluten-free-609385">Healthy Chunky Monkey CakeÃ¢â‚¬Â¦ aka Peanut Butter Banana Cake with Chocolate Peanut Butter Frosting! (sugar free, high protein & gluten free)</a>, <a href="https://spoonacular.com/recipes/thousand-island-dressing-gluten-free-corn-free-dairy-free-soy-free-nut-free-gum-free-and-refined-sugar-free-512186">Thousand Island Dressing (Gluten-Free, Corn-Free, Dairy-Free, Soy-Free, Nut-Free, Gum-Free and Refined Sugar-Free)</a>, and <a href="https://spoonacular.com/recipes/peanut-butter-chocolate-chip-granola-bars-no-bake-vegan-gluten-free-soy-free-520579">Peanut Butter Chocolate Chip Granola Bars (No-Bake, Vegan, Gluten-Free, Soy-Free)</a> for similar recipes.',
