				'If you have roughly <b>about 45 minutes</b> to spend in the kitchen, Beans Hawaiian might be an amazing <b>gluten free and dairy free</b> recipe to try. This recipe serves 8 and costs $1.61 per serving. One portion of this dish contains about <b>29g of protein</b>, <b>10g of fat</b>, and a total of <b>442 calories</b>. This recipe from Foodista requires navy beans, brown sugar, bacon, and ham steak. Not a lot of people made this recipe, and 6 would say it hit the spot. Overall, this recipe earns a <b>pretty good spoonacular score of 63%</b>. Similar recipes include <a href="https://spoonacular.com/recipes/hawaiian-barbecue-beans-424564">Hawaiian Barbecue Beans</a>, <a href="https://spoonacular.com/recipes/green-beans-with-fermented-black-beans-aka-dirty-green-beans-603179">green beans with fermented black beans ~ aka dirty green beans</a>, and <a href="https://spoonacular.com/recipes/blue-hawaiian-127693">Blue Hawaiian</a>.',
