			summary:
				'Need a <b>gluten free and dairy free main course</b>? Instant Pot Chicken Taco Soup could be a great recipe to try. One serving contains <b>346 calories</b>, <b>25g of protein</b>, and <b>8g of fat</b>. This recipe serves 4. For <b>$2.72 per serving</b>, this recipe <b>covers 40%</b> of your daily requirements of vitamins and minerals. 6 people have made this recipe and would make it again. This recipe is typical of Mexican cuisine. Head to the store and pick up chili powder, green onion, canned tomatoes, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>25 minutes</b>. It is perfect for <b>Autumn</b>. It is brought to you by Pink When. Taking all factors into account, this recipe <b>earns a spoonacular score of 99%</b>, which is spectacular. Similar recipes are <a href="https://spoonacular.com/recipes/instant-pot-chicken-taco-soup-944691">Instant Pot Chicken Taco Soup</a>, <a href="https://spoonacular.com/recipes/instant-pot-taco-soup-937475">Instant Pot Taco Soup</a>, and <a href="https://spoonacular.com/recipes/instant-pot-taco-soup-953509">Instant Pot Taco Soup</a>.',
