			summary:
				'Cheesy Chicken Enchilada Quinoa Casserole might be just the main course you are searching for. This gluten free recipe serves 4 and costs <b>$2.62 per serving</b>. One serving contains <b>594 calories</b>, <b>34g of protein</b>, and <b>24g of fat</b>. <b>Autumn</b> will be even more special with this recipe. 9912 people have tried and liked this recipe. From preparation to the plate, this recipe takes about <b>30 minutes</b>. Head to the store and pick up chili powder, cumin, verde enchilada sauce, and a few other things to make it today. To use up the avocado you could follow this main course with the <a href="https://spoonacular.com/recipes/chocolate-avocado-mousse-quick-dark-chocolate-avocado-mousse-486646">chocolate avocado mousse | quick dark chocolate avocado mousse</a> as a dessert. This recipe is typical of Mexican cuisine. All things considered, we decided this recipe <b>deserves a spoonacular score of 98%</b>. This score is excellent. Try <a href="https://spoonacular.com/recipes/cheesy-chicken-enchilada-casserole-163123">Cheesy Chicken Enchilada Casserole</a>, <a href="https://spoonacular.com/recipes/quinoa-chicken-enchilada-casserole-622079">Quinoa Chicken Enchilada Casserole</a>, and <a href="https://spoonacular.com/recipes/the-heartbreak-of-success-and-a-healthy-easy-and-cheesy-chicken-and-brown-rice-enchilada-casserole-575434">The Heartbreak of Success, and A Healthy, Easy, and Cheesy Chicken and Brown Rice Enchilada Casserole</a> for similar recipes.',
