			summary:
				'Roasted Lemon Pepper Pork Tenderloin with Cornbread Stuffing might be just the <b>Southern</b> recipe you are searching for. This recipe makes 4 servings with <b>412 calories</b>, <b>41g of protein</b>, and <b>16g of fat</b> each. For <b>$2.23 per serving</b>, this recipe <b>covers 33%</b> of your daily requirements of vitamins and minerals. <b>Thanksgiving</b> will be even more special with this recipe. 65 people have made this recipe and would make it again. A few people really liked this main course. From preparation to the plate, this recipe takes around <b>1 hour and 30 minutes</b>. If you have salt and pepper, chicken broth, pork tenderloin, and a few other ingredients on hand, you can make it. To use up the salt and pepper you could follow this main course with the <a href="https://spoonacular.com/recipes/dr-pepper-cake-with-flour-cooked-frosting-539165">Dr. Pepper Cake with Flour Cooked Frosting</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 90%</b>. This score is tremendous. Try <a href="https://spoonacular.com/recipes/roasted-pork-tenderloin-with-sage-cornbread-crust-312143">Roasted Pork Tenderloin with Sage Cornbread Crust</a>, <a href="https://spoonacular.com/recipes/grilled-lemon-pepper-pork-tenderloin-161472">Grilled Lemon-Pepper Pork Tenderloin</a>, and <a href="https://spoonacular.com/recipes/pork-tenderloin-stuffed-with-spinach-roasted-bell-pepper-mushroom-and-parmesan-497486">Pork Tenderloin Stuffed with Spinach, Roasted Bell Pepper, Mushroom, and Parmesan</a> for similar recipes.',
