			occasions: ['thanksgiving'],
			instructions:
				'<ol><li>Preheat your oven to 375 degrees F. Line a large baking sheet with foil and spray it with a nonstick spray. Season the pork tenderloin generously with the lemon pepper seasoning, rubbing it all over. Place the pork tenderloin on the prepared baking sheet and spray the pork with a nonstick spray. Place it in the oven and roast for about 45 minutes to 1 hour or until done to your liking. Use an instant read thermometer for desired level of doneness.</li><li>While the pork is roasting, prepare your crumbled cornbread. To a large bowl, add the cornbread, egg, jalapeno, parsley, green onions, salt and black pepper to taste, and milk. Stir to combine and pour it into an oven-safe baking dish that has been sprayed with a nonstick spray. Place it in the oven with pork and bake for 20 minutes or until slightly brown on top. Remove from oven and cover with foil to keep warm while you prepare the rest of your meal.</li><li>When the pork has finished roasting, remove it from the oven and pour the juices (if there are any) into a large nonstick skillet set over medium heat. Cover the pork tenderloin with a foil tent and allow it to rest for 10 minutes. Add the butter to the pan with the juices. If the pork has not released any juices, add an extra tablespoon or two of butter. Melt the butter and then whisk in the flour. Let cook for a minute or until golden brown, then whisk in the chicken broth and continue whisking until the sauce is a thick gravy. Season generously with salt and black pepper to taste. Remove from heat.</li><li>Slice the pork and set it over a bed of cornbread stuffing.</li><li>Serve with your favorite veggies and enjoy!</li></ol>',
